import React from 'react';


function scrollUp() {

    return (
        <a id="scrollUp"
           href="#top"
           style="position: fixed; z-index: 2147483647; display: block;"
        ><i className="fa fa-angle-up" aria-hidden="true"></i></a>

    );

}

export default scrollUp;
